to those Obtained Experimentally</p> \n                        <p>Authors: Lukasz G. Migas, Christopher J. Gray, Sabine L. Flitsch and Perdita E. Barran</p>\n                        <p>DOI: - not available yet</p>\n\n                        Here we show the collision cross sections (CCS) for each charge scheme \n                        (Mulliken, APT, MK, CHelpG, HLY and NPA) computed using MOBCAL (in nitrogen buffer gas) \n                        with partial charges computed combination of functionals (HF, B3LYP and M05) and basis sets \n                        (STO-3G, 3-21G, 6-31G, 6-31+G and 6-31G*). \n\n                        Interactive tools:\n                        <font color='green'>Hover</font>  - hover over any data point and it will bring detailed \n                        information about partial atomic charge, standard error, atom ID\n                        <font color='green'>Zoom</font> - drag on the plot to zoom on specific region of interest\n                        <font color='green'>Legend</font> - click on legend marker to select/deselect datasets ","width":800},"id":"f4cf9b75-f30c-4b31-83dd-dd27edaee66d","type":"Div"},{"attributes":{"overlay":{"id":"2e7c3223-0126-469a-b23f-1a12e857ce1d","type":"BoxAnnotation"},"plot":{"id":"80c06f7b-d583-4d08-86bb-221cb8fe5c9d","subtype":"Figure","type":"Plot"}},"id":"0c58d789-5998-44dc-8eaf-ff858a71ae32","type":"BoxZoomTool"},{"attributes":{"line_color":{"value":"#000080"},"line_width":{"value":5},"x0":{"field":"x"},"x1":{"field":"x"},"y0":{"field":"yLow"},"y1":{"field":"yHigh"}},"id":"67fff17b-6869-4679-bbca-b6a9d6793fda","type":"Segment"},{"attributes":{"callback":null,"end":150,"start":115},"id":"fd0bd34a-294d-428d-a507-45f5894cd874","type":"Range1d"},{"attributes":{"line_color":{"value":"#000080"},"line_width":{"value":5},"x0":{"field":"x"},"x1":{"field":"x"},"y0":{"field":"yLow"},"y1":{"field":"yHigh"}},"id":"7a6d0eda-acd3-4aad-80d4-2fbd5329d147","type":"Segment"},{"attributes":{"line_color":{"valu fic region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"1aacbd7f-bf7c-4671-b6d0-6c74fcad1177","type":"Div"},{"attributes":{"data_source":{"id":"0eefd15f-bfd8-44f6-bbeb-26a37bef0d70","type":"ColumnDataSource"},"glyph":{"id":"cccf40a7-9b5d-4d81-8ee9-b47cb51183bf","type":"Segment"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"6ab99ea0-55d9-4fc3-af29-d95c7a53463e","type":"Segment"},"selection_glyph":null},"id":"124c936d-62f5-4c22-ae23-15771b2bd929","type":"GlyphRenderer"},{"attributes":{"axis_label":"CCS (\u00c5\u00b2)","axis_label_text_font_size":{"value":"14pt"},"axis_label_text_font_style":"bold","formatter":{"id":"25a21641-3624-490e-b8f9-f760ab473d50","type":"BasicTickFormatter"},"major_label_text_font_size":{"value":"12pt"},"major_label_text_font_style":"bold","plot":{"id":"16f8a686-a3a8-4380-98af-de383cda4aa0","subtype":"Figure","type":"Plot"},"ticker":{"id":"f869cb58-ad40-4f7a-b9e1-c505aca8d1e5","type":"BasicTicker"}},"id":"ad517d25-7bd6-44dd-ac90-4e58416d5e50","type":"LinearAxis"},{"attributes":{"fill_color":{"value":"#000080"},"size":{"units":"screen","value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"3048f992-2744-4c47-bf4b-fb886c45a143","type":"Square"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"c7f8dd55-eb88-44c5-adb9-5f92e2bfccf2","type":"Square"},{"attributes":{"fill_color":{"value":"#008000"},"size":{"units":"screen","value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"3e21d664-d812-4cbf-87d5-d6a6bf5e0f5d","type":"Square"},{"attributes":{"label":{"value":"B3LYP/6-31G"},"renderers":[{"id":"2655cb54-b8d8-48f7-8481-526696d9d697","type":"GlyphRenderer"},{"id":"14f3d409-f26a-4741-947b-1849e007d40a","type":"GlyphRenderer"}]},"id":"38ffdc25-4041-4cd0- et</p>\n                        <p>Here we show the collision cross sections (CCS) for each charge scheme \n                        (Mulliken, APT, MK, CHelpG, HLY and NPA) computed using MOBCAL (in nitrogen buffer gas) \n                        with partial charges computed combination of functionals HF (a), B3LYP (b) and M05 (c) and basis sets \n                        STO-3G (<b><font color='#000080'>blue</font></b>), \n                        3-21G (<b><font color='#FF0080'>magenta</font></b>),\n                        6-31G (<b><font color='#008000'>green</font></b>), \n                        6-31+G (<b><font color='#FF8000'>orange</font></b>) \n                        and 6-31G* (<b><font color='#8009FF'>purple</font></b>).</p> \n                        <p>Interactive tools:</p>\n                        <p><b><font color='green'>Hover</b></font>  - hover over any data point and it will bring detailed \n                        information about partial atomic charge, standard error, atom ID</p>\n                        <p><b><font color='green'>Zoom</b></font> - drag on the plot to zoom on specific region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"0ffd30dc-7bbd-4c04-800a-ee04c461f37f","type":"Div"},{"attributes":{"data_source":{"id":"1d8e4850-aec5-49d2-bfa0-6596e4564189","type":"ColumnDataSource"},"glyph":{"id":"029185b0-463f-47c5-92c5-8a13eb99e173","type":"Segment"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"cf569477-f1e4-499d-a361-605f36ad7d5a","type":"Segment"},"selection_glyph":null},"id":"6255c201-0d8f-4bfb-9a4a-aaf756162e09","type":"GlyphRenderer"},{"attributes":{"formatter":{"id":"ba31ecf8-d735-4690-b893-e83d668df5ed","type":"FuncTickFormatter"},"major_label_orientation":0.7853981633974483,"major_label_text_font_size":{"value":"12pt"},"major_label_text_font_style":"bold","minor_tick_line_color":{"value":null},"pl                   STO-3G (<b><font color='#000080'>blue</font></b>), \n                        3-21G (<b><font color='#FF0080'>magenta</font></b>),\n                        6-31G (<b><font color='#008000'>green</font></b>), \n                        6-31+G (<b><font color='#FF8000'>orange</font></b>) \n                        and 6-31G* (<b><font color='#8009FF'>purple</font></b>).</p> \n                        <p>Interactive tools:</p>\n                        <p><b><font color='green'>Hover</b></font>  - hover over any data point and it will bring detailed \n                        information about partial atomic charge, standard error, atom ID</p>\n                        <p><b><font color='green'>Zoom</b></font> - drag on the plot to zoom on specific region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"70696b1a-fea3-4a68-8e99-79d270b9b1fe","type":"Div"},{"attributes":{"line_color":{"value":"#8009FF"},"line_width":{"value":5},"x0":{"field":"x"},"x1":{"field":"x"},"y0":{"field":"yLow"},"y1":{"field":"yHigh"}},"id":"56f05dec-5224-4332-aaef-a2fdf4e9dd92","type":"Segment"},{"attributes":{},"id":"598c711b-c687-437a-a842-5b6869d5db94","type":"LinearScale"},{"attributes":{"active_drag":{"id":"7f8938b8-c926-49dc-92d7-80ea4a876845","type":"BoxZoomTool"},"active_inspect":"auto","active_scroll":"auto","active_tap":"auto","tools":[{"id":"3ec633d0-2a41-4f9b-831e-029e4903f8f6","type":"HoverTool"},{"id":"7f8938b8-c926-49dc-92d7-80ea4a876845","type":"BoxZoomTool"},{"id":"fe4650d1-dbfb-48a6-858a-f20452aadc47","type":"PanTool"},{"id":"878e5b98-b862-43d4-a163-a4874fbca2e1","type":"WheelZoomTool"},{"id":"0b7304df-7d32-4d18-812b-5e6d21191023","type":"ResetTool"},{"id":"0e1d52df-f4ef-46ce-8e39-e7131506b299","type":"SaveTool"}]},"id":"12bd97e9-4220-4b5b-8713-d1391afa8a22","type":"Toolbar"},{"attributes":{"callback":null,"column_names":["chargeScheme","yErrPerc","labels"             and basis sets \n                        STO-3G (<b><font color='#000080'>blue</font></b>), \n                        3-21G (<b><font color='#FF0080'>magenta</font></b>),\n                        6-31G (<b><font color='#008000'>green</font></b>), \n                        6-31+G (<b><font color='#FF8000'>orange</font></b>) \n                        and 6-31G* (<b><font color='#8009FF'>purple</font></b>).</p> \n                        <p>Interactive tools:</p>\n                        <p><b><font color='green'>Hover</b></font>  - hover over any data point and it will bring detailed \n                        information about partial atomic charge, standard error, atom ID</p>\n                        <p><b><font color='green'>Zoom</b></font> - drag on the plot to zoom on specific region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"371caf14-7dc9-49fd-9cb4-a8e3c2c0d3e3","type":"Div"},{"attributes":{"label":{"value":"M05/6-31G*"},"renderers":[{"id":"51bd4126-9077-4ece-9dd6-ce516477076a","type":"GlyphRenderer"},{"id":"b1f59b16-b3b6-4f40-bd2c-e41927bc2002","type":"GlyphRenderer"}]},"id":"34adfd77-faaf-4b74-867b-da8cc8101d73","type":"LegendItem"},{"attributes":{"data_source":{"id":"f1e2591c-c277-4d4d-8022-aafed5b74f69","type":"ColumnDataSource"},"glyph":{"id":"30f9a4c2-0275-44d8-8b2e-f189ed9ba3af","type":"Square"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"c49f76d8-7fe2-453f-b19a-a3b1db288548","type":"Square"},"selection_glyph":null},"id":"c8ea2be9-451d-4512-85bf-cb55efff5ca1","type":"GlyphRenderer"},{"attributes":{"data_source":{"id":"688cede5-9f6f-4fb8-9727-9ced20278c7b","type":"ColumnDataSource"},"glyph":{"id":"5b3bfef0-d42a-46ca-98b5-9ad8ad3265fe","type":"Segment"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"5ce6f2ec-01bb-4173-8163-584d5241d52e","type":"Segment"},"selection_glyph":null},"id":"68920 lly</p> \n                        <p><b>Authors</b>: Lukasz G. Migas, Christopher J. Gray, Sabine L. Flitsch and Perdita E. Barran</p>\n                        <p><b>DOI</b>: - not available yet</p>\n                        <p>Here we show the collision cross sections (CCS) for each charge scheme \n                        (Mulliken, APT, MK, CHelpG, HLY and NPA) computed using MOBCAL (in nitrogen buffer gas) \n                        with partial charges computed combination of functionals HF (<b>a</b>), B3LYP (<b>b</b>) and M05 (<b>c</b>)\n                        and basis sets \n                        STO-3G (<b><font color='#000080'>blue</font></b>), \n                        3-21G (<b><font color='#FF0080'>magenta</font></b>),\n                        6-31G (<b><font color='#008000'>green</font></b>), \n                        6-31+G (<b><font color='#FF8000'>orange</font></b>) \n                        and 6-31G* (<b><font color='#8009FF'>purple</font></b>).</p> \n                        <p>Interactive tools:</p>\n                        <p><b><font color='green'>Hover</b></font>  - hover over any data point and it will bring detailed \n                        information about partial atomic charge, standard error, atom ID</p>\n                        <p><b><font color='green'>Zoom</b></font> - drag on the plot to zoom on specific region of interest</p>\n                        <p><b><font color='green'>Legend</b></font> - click on legend marker to select/deselect datasets</p> ","width":800},"id":"6553fb32-4b6f-4e44-8872-356734bf3b8e","type":"Div"},{"attributes":{"dimension":1,"grid_line_alpha":{"value":0.7},"plot":{"id":"16f8a686-a3a8-4380-98af-de383cda4aa0","subtype":"Figure","type":"Plot"},"ticker":{"id":"f869cb58-ad40-4f7a-b9e1-c505aca8d1e5","type":"BasicTicker"}},"id":"e0dd1a02-505f-4a7b-9c07-150b890df9e1","type":"Grid"},{"attributes":{"bottom_units":"screen","fill_alpha":{"value":0.5},"fill_color":{"value":"lightgrey"},"left_units":"screen","level":"ove
